import React from 'react'
import styled from 'styled-components'
import iconsSprite from '../../assets/img/icons/icons-sprite.svg'

type IconPropsType = {
	iconId:string
	width?: string;
	height?: string;
	viewBox?: string;
	ariaLabel?: string;
}

export const Icon = (props: IconPropsType) => {
	return (
		<IconStyles width={props.width || "100"} height={props.height || "100"} viewBox={props.viewBox || "0 0 120 120"} aria-label={props.ariaLabel} fill='none' xmlns='http://www.w3.org/2000/svg'>
			<use xlinkHref={`${iconsSprite}#${props.iconId}`} />
		</IconStyles>
	)
}


const IconStyles = styled.svg `
fill: transparent;


`
